def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None and not isinstance(group_axis, MultiIndex):
        if isinstance(level, str) and obj.columns.name != level:
            raise ValueError(
                "level name {} is not the name of the columns".format(level)
            )

    if not isinstance(key, list):
        key = [key]

    keys = [com.asarray_tuplesafe(key) for key in keys]

    groupings = []
    exclusions = []

    for i, (gpr, level) in enumerate(zip(keys, level)):
        if gpr in obj.columns:
            if validate:
                obj._check_label_or_level_ambiguity(gpr)
            groupings.append(
                Grouping(
                    group_axis,
                    obj[gpr],
                    obj=obj,
                    name=None,
                    level=level,
                    sort=sort,
                    observed=observed,
                    in_axis=True,
                )
            )
        else:
            raise KeyError(gpr)

    if len(groupings) == 0 and len(obj):
        raise ValueError("No group keys passed!")
    elif len(groupings) == 0:
        groupings.append(Grouping(Index([], dtype="int"), np.array([], dtype=np.intp)))

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
